import React, { useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
import { 
    Button, 
    TextField, 
    Card, 
    CardContent, 
    Box, 
    Typography,
    Container,
    InputAdornment,
    IconButton,
    Paper
} from '@mui/material';
import { makeStyles } from '@mui/styles';
import { setAuthToken } from '../../utils/auth';
import { buildApiUrl } from '../../config/api';
import { 
    Person as PersonIcon,
    Lock as LockIcon,
    Visibility as VisibilityIcon,
    VisibilityOff as VisibilityOffIcon 
} from '@mui/icons-material';

const useStyles = makeStyles({
    root: {
        minHeight: '100vh',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        background: 'linear-gradient(135deg, #001f3f 0%, #1a365d 100%)',
        padding: '20px',
    },
    card: {
        backgroundColor: 'rgba(255, 255, 255, 0.95)',
        boxShadow: '0 8px 32px rgba(0, 0, 0, 0.2)',
        borderRadius: '16px',
        maxWidth: '450px',
        width: '100%',
        padding: '40px 30px',
        textAlign: 'center',
        transition: 'transform 0.3s ease-in-out',
        '&:hover': {
            transform: 'translateY(-5px)',
        },
    },
    debugBox: {
        position: 'fixed',
        bottom: '20px',
        right: '20px',
        width: '300px',
        padding: '15px',
        backgroundColor: 'rgba(0, 0, 0, 0.8)',
        color: '#00ff00',
        fontFamily: 'monospace',
        borderRadius: '8px',
        zIndex: 1000,
        maxHeight: '300px',
        overflowY: 'auto',
    },
    debugTitle: {
        color: '#fff',
        borderBottom: '1px solid #00ff00',
        paddingBottom: '8px',
        marginBottom: '8px',
    },
    debugItem: {
        margin: '5px 0',
        wordBreak: 'break-all',
    },
    form: {
        display: 'flex',
        flexDirection: 'column',
        gap: '24px',
        marginTop: '32px',
    },
    textField: {
        '& .MuiOutlinedInput-root': {
            borderRadius: '12px',
            '&:hover fieldset': {
                borderColor: '#1976d2',
            },
        },
    },
    button: {
        marginTop: '16px',
        padding: '12px',
        borderRadius: '12px',
        fontSize: '16px',
        fontWeight: 600,
        textTransform: 'none',
        backgroundColor: '#1976d2',
        '&:hover': {
            backgroundColor: '#1565c0',
        },
    },
    signupButton: {
        marginTop: '12px',
        borderRadius: '12px',
        textTransform: 'none',
    },
    welcomeText: {
        color: '#1976d2',
        marginBottom: '8px',
        fontWeight: 700,
        fontSize: '2rem',
    },
    subtitle: {
        color: '#666',
        marginBottom: '24px',
    },
});

const Login = ({ selectedOption }) => {
    const classes = useStyles();
    const [formData, setFormData] = useState({
        email: '',
        password: ''
    });
    const [showPassword, setShowPassword] = useState(false);
    const [debugInfo, setDebugInfo] = useState({
        attempts: 0,
        lastAttempt: null,
        serverResponse: null,
        error: null
    });
    const navigate = useNavigate();

    const handleLogin = async (e) => {
        e.preventDefault();
        setDebugInfo(prev => ({
            ...prev,
            attempts: prev.attempts + 1,
            lastAttempt: new Date().toISOString(),
            serverResponse: 'Preparing request...',
            error: null
        }));

        try {
            // Log the request details
            const apiUrl = buildApiUrl('/api/login');
            console.log('Login Request:', {
                url: apiUrl,
                data: { email: formData.email }  // Don't log password
            });

            setDebugInfo(prev => ({
                ...prev,
                serverResponse: `Sending request to ${apiUrl}...`,
            }));

            const response = await axios.post(apiUrl, formData);

            console.log('Server Response:', {
                status: response.status,
                headers: response.headers,
                data: response.data
            });

            setDebugInfo(prev => ({
                ...prev,
                serverResponse: `Response received: ${JSON.stringify(response.data, null, 2)}`,
            }));

            // Check if we have a valid response with token
            if (!response.data || !response.data.token) {
                throw new Error(`Invalid response from server - no token received. Response: ${JSON.stringify(response.data)}`);
            }

            setDebugInfo(prev => ({
                ...prev,
                serverResponse: 'Token received',
            }));

            // Set token in localStorage and auth headers
            const { token, user } = response.data;
            localStorage.clear(); // Clear any old data
            localStorage.setItem('token', token);
            setAuthToken(token);

            // Set user role
            const userRole = user.role;
            localStorage.setItem('userRole', userRole);

            setDebugInfo(prev => ({
                ...prev,
                serverResponse: `Login successful. Role: ${userRole}`,
            }));

            const roleToRoute = {
                'Admin': 'AdminProfile',
                'Doctor': 'DoctorProfile',
                'Patient': 'ClientProfile',
                'Client': 'ClientProfile'
            };

            const redirectPath = `/${roleToRoute[userRole]}`;
            if (!redirectPath) {
                throw new Error(`Invalid user role: ${userRole}`);
            }

            // Navigate with user data
            navigate(redirectPath, { 
                state: { 
                    user,
                    isAuthenticated: true
                } 
            });

        } catch (error) {
            console.error('Login error:', error);
            const errorResponse = error.response?.data;
            const errorMessage = errorResponse?.message || error.message || 'Login failed. Please check your credentials.';

            setDebugInfo(prev => ({
                ...prev,
                serverResponse: `Error occurred:\n${error.message}\nResponse: ${JSON.stringify(errorResponse, null, 2)}`,
                error: errorMessage
            }));

            // Clear any partial data
            localStorage.removeItem('token');
            localStorage.removeItem('userRole');
            setAuthToken(null);

            alert(errorMessage);
        }
    };

    const handleSignup = () => {
        let optval = "/" + selectedOption + "Signup";
        navigate(optval, { replace: true });
    };

    return (
        <Box className={classes.root}>
            <Container maxWidth="sm">
                <Card className={classes.card}>
                    <CardContent>
                        <Typography variant="h4" className={classes.welcomeText}>
                            Welcome Back
                        </Typography>
                        <Typography variant="body1" className={classes.subtitle}>
                            Please sign in to continue
                        </Typography>

                        <form className={classes.form} onSubmit={handleLogin}>
                            <TextField
                                className={classes.textField}
                                fullWidth
                                id="email"
                                label="Email"
                                type="email"
                                variant="outlined"
                                value={formData.email}
                                onChange={(e) => setFormData({ ...formData, email: e.target.value })}
                                required
                                InputProps={{
                                    startAdornment: (
                                        <InputAdornment position="start">
                                            <PersonIcon color="action" />
                                        </InputAdornment>
                                    ),
                                }}
                            />

                            <TextField
                                className={classes.textField}
                                fullWidth
                                id="password"
                                label="Password"
                                type={showPassword ? 'text' : 'password'}
                                variant="outlined"
                                value={formData.password}
                                onChange={(e) => setFormData({ ...formData, password: e.target.value })}
                                required
                                InputProps={{
                                    startAdornment: (
                                        <InputAdornment position="start">
                                            <LockIcon color="action" />
                                        </InputAdornment>
                                    ),
                                    endAdornment: (
                                        <InputAdornment position="end">
                                            <IconButton
                                                onClick={() => setShowPassword(!showPassword)}
                                                edge="end"
                                            >
                                                {showPassword ? <VisibilityOffIcon /> : <VisibilityIcon />}
                                            </IconButton>
                                        </InputAdornment>
                                    ),
                                }}
                            />

                            <Button
                                className={classes.button}
                                fullWidth
                                variant="contained"
                                type="submit"
                            >
                                Sign In
                            </Button>

                            <Button
                                className={classes.signupButton}
                                fullWidth
                                variant="outlined"
                                onClick={handleSignup}
                            >
                                Create New Account
                            </Button>
                        </form>
                    </CardContent>
                </Card>
            </Container>

            {/* Debug Box */}
            <Paper className={classes.debugBox}>
                <Typography variant="h6" className={classes.debugTitle}>
                    Login Debug Info
                </Typography>
                <Typography className={classes.debugItem}>
                    Attempts: {debugInfo.attempts}
                </Typography>
                <Typography className={classes.debugItem}>
                    Last Attempt: {debugInfo.lastAttempt || 'None'}
                </Typography>
                <Typography className={classes.debugItem}>
                    Server Response: {debugInfo.serverResponse || 'None'}
                </Typography>
                {debugInfo.error && (
                    <Typography className={classes.debugItem} style={{ color: '#ff4444' }}>
                        Error: {debugInfo.error}
                    </Typography>
                )}
                <Typography className={classes.debugItem}>
                    Token: {localStorage.getItem('token') || 'None'}
                </Typography>
                <Typography className={classes.debugItem}>
                    User Role: {localStorage.getItem('userRole') || 'None'}
                </Typography>
            </Paper>
        </Box>
    );
};

export default Login;
